import React, { Component } from 'react';
import jwt_decode from 'jwt-decode';
import ReactDOM from 'react-dom';


class Profile extends Component {
    constructor() {
        super();
        this.state ={
        username: '',
        email: '',
        ratings: []
        }
    }

    componentDidMount() {
        const token = localStorage.usertoken;
        const decoded = jwt_decode(token);
        let ratings = decoded.ratings;
        console.log(ratings);
        this.setState({
            username: decoded.username,
            email: decoded.email,
            type: decoded.type,
        })
        var start = "";
        var table = document.createElement("table");
        var tableLine = document.createElement("tr");
        var tablePart = document.createElement("td");

        let ratingTable = document.createElement("div");
        for(let i=0;i<ratings.length;i++){
            var textCity = document.createTextNode(ratings[i].city);
            var textStars = document.createTextNode(ratings[i].amountOfStars);
            var textMessage = document.createTextNode(ratings[i].message);
        }
        var temp = document.getElementById("ratingProfile");
        temp.appendChild(ratingTable);
        //ReactDOM.render(ratingTable, document.getElementById('ratingProfile'));
    }

    render() {
        return (
            <div id="profileInfo">
                <table>
                    <tbody>
                        <tr>
                            <td>Username</td>
                            <td>{this.state.username}</td>
                        </tr>
                        <tr>
                            <td>Email</td>
                            <td>{this.state.email}</td>
                        </tr>
                        <tr>
                            <td>type</td>
                            <td>{this.state.type}</td>
                        </tr>
                        <tr>
                            <td>ratings</td>
                            <td>
                                {this.state.ratings}
                                <table>
                                    <tbody id="ratingProfile">

                                    </tbody>
                                </table>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </div>
        )
    }

}


export default Profile
